repeat.for_each:
{% set result = namespace(entities=[]) %} {% for domain in ['light', 'switch', 'binary_sensor', 'climate', 'cover', 'fan', 'media_player', 'scene', 'automation'] %}
  {% for entity in states[domain] %}
    {% set attributes_list = [] %}
    {% for key, value in entity.attributes.items() %}
      {% if value is string or value is number or value is boolean %}
        {% set attributes_list = attributes_list + [{'key': key, 'value': value}] %}
      {% else %}
        {% set attributes_list = attributes_list + [{'key': key, 'value': value | string}] %}
      {% endif %}
    {% endfor %}
    {% set entity_data = {
      'entity_id': entity.entity_id,
      'state': entity.state,
      'attributes': attributes_list | map(attribute='value') | list,
      'last_changed': entity.last_changed | string
    } %}
    {% set result.entities = result.entities + [entity_data] %}
  {% endfor %}
{% endfor %} {{ result.entities | tojson }}

data.value:
{
  {% set ns = namespace(first=true) %}
  {% for domain in ['light', 'switch', 'binary_sensor', 'climate', 'cover', 'fan', 'media_player'] %}
    {% for entity in states[domain] %}
      {% if not ns.first %},{% endif %}
      {% set ns.first = false %}
      "{{ entity.entity_id }}": {
        "state": "{{ entity.state }}",
        "last_changed": "{{ current_timestamp }}"
      }
    {% endfor %}
  {% endfor %}
}
